import React, { Component } from "react";
    

export default class Usage extends Component {
    render(){
        return(
            <div>
                <div className="row">
                    
                    <div className="col-md-12">
                        <div className="row">
                        Subscription type: <span>&nbsp;&nbsp;&nbsp;Basic</span>
                        </div>
                        &nbsp;
                        <div className="row">
                        Subscription Usage: <span>&nbsp;&nbsp;&nbsp;Basic</span>
                        </div>
                    </div>
                    
                </div>
            </div>
        )  
    }
}
